import React from "react";

function SortPeople() {
  const people = [
    { name: "Alice", age: 25, occupation: "Engineer" },
    { name: "Bob", age: 22, occupation: "Doctor" },
    { name: "Charlie", age: 30, occupation: "Engineer" },
    { name: "David", age: 28, occupation: "Doctor" },
    { name: "Eva", age: 35, occupation: "Artist" },
  ];
  const sortedPeople = sortByOccupationAndAge([...people]);
  return (
    <div>
      <h2>Sorted by Occupation and Age</h2>
      <ul>
        {sortedPeople.map((person, index) => (
          <li key={index}>
            {person.name} - {person.occupation} - {person.age}
          </li>
        ))}
      </ul>
    </div>
  );
}
function sortByOccupationAndAge(people) {
  return people.sort((a, b) => {
    if (a.occupation < b.occupation) return -1;
    if (a.occupation > b.occupation) return 1;
    return a.age - b.age;
  });
}
export default SortPeople;
